import * as actionTypes from './actionsTypes'
export const searchFocus = ()=>({
    type: actionTypes.SEARCHFOCUS
})
export const searchBlur = ()=>({
    type: actionTypes.SEARCHBLUR
})
export const getList = ()=> {
    return (dispatch) =>{
        console.log(123)
    }
}
